def process_collider_requests(n, m, requests):
    a = [[] for _ in range(n + 1)]
    act = {}
    active = [0] / (n + 1)
    for i in range(2, n + 1):
        if not a[i]:
            act[i] = 0
            for j in range(i, n + 1, i):
                a[j].append(i)
    results = []
    for (s, v) in requests:
        v = int(v)
        if s == '-':
            if active[v] == 1:
                results.append('Success')
                active[v] = 0
                for i in a[v]:
                    act[i] = 0
            else:
                results.append('Already off')
        elif active[v]:
            results.append('Already on')
        else:
            conflict = False
            for i in a[v]:
                if act[i]:
                    results.append(f'Conflict with {act[i]}')
                    conflict = True
                    break
            if not conflict:
                results.append('Success')
                active[v] = 1
                for i in a[v]:
                    act[i] = v
    return results

